import React from 'react';
import './App.css';
import AddSample from './Pages/AddSample';

import { BrowserRouter as Router, Routes, Route } from 'react-router-dom'; // Update for React Router v6

function App() {
  return (
    <Router>
      <div>
        <Routes>
          <Route path="/add-sample" element={<AddSample />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
